    Ponto inicio;
    Ponto fim;
}Reta;

int main(){
    Reta r;
    printf(""Digite o ponto inicial da reta: "");
    scanf(""%d %d"", &r.inicio.x, &r.inicio.y);
    printf(""Digite o ponto final da reta: "");
    scanf(""%d %d"", &r.fim.x, &r.fim.y);
    printf(""A reta vai de (%d, %d) a (%d, %d).
"", r.inicio.x, r.inicio.y, r.fim.x, r.fim.y);
